-- ----------------------------
-- Table structure for bpm_log
-- ----------------------------
DROP TABLE IF EXISTS `bpm_log`;
CREATE TABLE `bpm_log` (
  `InstanceID` bigint(20) NOT NULL default '0',
  `LogID` int(11) NOT NULL default '0',
  `LogIndex` int(11) default NULL,
  `InlineNodeID` int(11) default NULL,
  `NodeID` int(11) default NULL,
  `WorkitemID` bigint(20) default NULL,
  `WorkitemName` varchar(255) default NULL,
  `WorkitemState` int(11) default NULL,
  `CreatTime` datetime default NULL,
  `FinishTime` datetime default NULL,
  `OperatorID` bigint(20) default NULL,
  `AuditResult` int(11) default NULL,
  `UserInfo` varchar(255) default NULL,
  `ResultInfo` varchar(255) default NULL,
  `LaunchInfo` varchar(255) default NULL,
  `TransactionID` int(11) default NULL,
  `assistTransactionID` int(11) default NULL,
  `MapCount` int(11) default NULL,
  `Slock` int(11) default NULL,
  `E_Signature` varchar(255) default NULL,
  `IPAddress` varchar(255) default NULL,
  PRIMARY KEY  (`InstanceID`,`LogID`),
  KEY `I_BPM_LogInstanceID` (`InstanceID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

