  `InstanceID` bigint(20) NOT NULL default '0',
  `InlineNodeID` int(11) NOT NULL default '0',
  `NodeID` int(11) NOT NULL default '0',
  `TransactionID` int(11) NOT NULL default '0',
  `InlineVersion` int(11) default NULL,
  `NodeType` int(11) default NULL,
  `Result` int(11) default NULL,
  `SubInstanceID` bigint(20) default NULL,
  `WorkitemID` bigint(20) default NULL,
  `assistTransactionID` int(11) default NULL,
  `MapCount` int(11) default NULL,
  `Slock` int(11) default NULL,
  PRIMARY KEY  (`InstanceID`,`InlineNodeID`,`NodeID`,`TransactionID`),
  KEY `I_BPM_NodeRBInstanceID` (`InstanceID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

