  `NodeID` int(11) default NULL,
  `OperatorID` bigint(20) NOT NULL default '0',
  `WorkitemID` bigint(20) NOT NULL default '0',
  `OperationNodeID` int(11) NOT NULL default '0',
  `TransactionID` int(11) default NULL,
  `AssistTransactionID` int(11) default NULL,
  `MapCount` int(11) default NULL,
  `Slock` int(11) default NULL,
  PRIMARY KEY  (`InstanceID`,`OperatorID`,`WorkitemID`,`OperationNodeID`),
  KEY `I_BPM_StateInstanceID` (`InstanceID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

