-- ----------------------------
-- Table structure for bpm_transaction
-- ----------------------------
DROP TABLE IF EXISTS `bpm_transaction`;
CREATE TABLE `bpm_transaction` (
  `InstanceID` bigint(20) NOT NULL default '0',
  `TransactionID` int(11) NOT NULL default '0',
  `WorkitemID` bigint(20) default NULL,
  `OperatorID` bigint(20) default NULL,
  `WorkitemRevoke` int(11) default NULL,
  `statusValue` int(11) default NULL,
  `MapCount` int(11) default NULL,
  `Slock` int(11) default NULL,
  PRIMARY KEY  (`InstanceID`,`TransactionID`),
  KEY `I_BPM_TransactionInstanceID` (`InstanceID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

