INSERT INTO `oa_emailinbox_h` VALUES ('123940', '123940', null, '0', '0', 'oa_test_info@163.com<oa_test_info@163.com>', 'minjian_1@qq.com<minjian_1@qq.com>,oa_test_info@163.com<oa_test_info@163.com>', 'oa_test_info@163.com<oa_test_info@163.com>', '测试11-10新包', '20', '20', 'oa_test_info@163.com', 'Data\\OA_EmailInbox\\123940\\Content.htm', '20', '<p><img src=\"data:image/png;base64,\" wangeditor_img_max_width_mark=\"1\" style=\"max-width: 100%;\"><img src=\"http://n.sinaimg.cn/translate/20161110/-I-f-fxxsmic5864071.jpg\" wangeditor_img_max_width_mark=\"1\" style=\"max-width: 100%;\"></p><p>　湖南首颗人造卫星“潇湘一号”\r\n<br>\r\n<br>　　相关链接：湖南首颗人造卫星送往酒泉 “潇湘一号”11月出征太空\r\n<br>\r\n<br>　　红网长沙11月10日讯(通讯员 余旭华 时刻新闻记者 易添麒)11月10日上午7点42分，湖南首颗人造卫星、中国首颗商业化科学实验卫星??“潇湘一号”在酒泉卫星发射基地搭载长征十一号运载火箭成功发射。标志着我国科学实验卫星商业化、产业化迈出了重要一步，湖南企业成功开创了中国民营企业商业航天的先河。\r\n<br>\r\n<br>　　“潇湘一号”卫星的设计基于国际立方星标准，这颗微小卫星重仅8千克，功耗23W，寿命半年到一年左右。由长沙高新区入驻企业天仪研究院自主研制，其研制周期（需求-设计-研制-发射 ）只用了不到一年的时间。\r\n<br>\r\n<br>　　“潇湘一号”卫星发射入轨后将进行多项航天新技术试验，其中包括，空间软件无线电试验、导航信号增强试验、新型星载计算机搭载试验、高精度光学稳像试验等，由天仪研究院和航天一院十四所、中科院光电院等航天传统优势单位联合研制。\r\n<br>\r\n<br>　　天仪研究院相关负责人表示，天仪研究院作为中国首批商业航天民营企业，致力于以传统航天工程经验为基础，结合商业市场产品开发的先进理念，建立全新的商业航天研制体系。此后，天仪研究院目标面向国内外的科学家和科研院所提供短周期、低成本、一站式的空间科学实验验证和技术验证服务。\r\n<br>\r\n<br>　　近年来，国外商业航天蓬勃发展，尤其在空间运输、卫星遥感等方面的商业化进展显著，涌现出了以太空探索公司(SpaceX)、行星实验室公司（planet labs）为代表的一批商业航天公司。\r\n<br>\r\n<br>　　随着中国长征火箭有限公司、长光卫星技术有限公司等国有企业的成立，中国航天也迎来了商业航天热潮。“潇湘一号”进入浩瀚太空，将成为中国商业航天史上的一座里程碑。\r\n<br>\r\n<br>　　今年12月份，天仪研究院与欧洲公司联合研制的另一颗微重力科学实验卫星将在国外发射。<br></p>', 'EI20161130000009', '2016-11-30 11:27:12', '100', '<23440528.1.1478759763094.JavaMail.xiaoyun@Alex-PC>', '2016-11-10 14:35:52', '20', '21277', '0', null, null, null);
