INSERT INTO `oa_emailinbox_h` VALUES ('123966', '123966', null, '0', '0', 'oa_test_info@163.com<oa_test_info@163.com>', 'oa_test_info@163.com<oa_test_info@163.com>,oa_test_info@163.com<oa_test_info@163.com>', '', '测试20161117', '20', '20', 'oa_test_info@163.com', 'Data\\OA_EmailInbox\\123966\\Content.htm', '20', '<p>原标题：基辛格给奥巴马对华表现打B+ 称大选令中方震惊\n<br>　　特朗普当选美国总统后，美前国务卿、70年代主导对华政策的基辛格 (Henry Alfred Kissinger) ，多次接受美国《大西洋月刊》专访，谈及此次美国大选、俄罗斯的未来、中国的崛起以及中东乱局等问题。\n<br>　　《大西洋月刊》总编杰戈登堡在专访中多次提到与中国相关的问题，基辛格批评美国总统奥巴马8年执政对华政策只着重短期结果，根据目前情况表现打分为“B+”，由于他的政策缺乏长远视野，评分在未来还会下降。\n<br>美国《大西洋月刊》网站截图1\n<br>美国《大西洋月刊》网站截图\n<br>　　据报道，93岁的基辛格首先对“奥巴马主义”表示，奥巴马似乎不认为自己是政治过程的一部分，自认是“独特的”个人，有特殊能力。他避免让美国“漠然的成分”造成国际不安，关切短期问题演变成长期阻碍，但“形塑历史”才是治国之道，而不是只做不沾锅。\n<br>　　基辛格认为，奥巴马对华态度不算“鹰派”，但如果要推进中美关系，美国必须掌握国际趋势。他表示，奥巴马不认为自己属于政治过程的一部分，“奥巴马主义”竭力避免美国造成国际动荡，奥巴马往往只关注短期利益，这种取态长远来说变成障碍。基辛格还认为，领袖应该积极塑造历史，而非任由历史自行发展。\n<br>　　基辛格给奥巴马任内处理中国议题的成绩打了“B+”。他说，这是视目前状况给的分数，若以美中关系长期演变来看，可能还要低些。奥巴马做了一些有利于中美关系短期发展的事，但是并没有对长期关系发展做出重大贡献。\n<br>　　基辛格解释，奥巴马对中国的态度并不是太强硬，但是太着眼于短期了。要真正提升美国与中国的关系，美国必须着眼于长远趋势。\n<br>基辛格给奥巴马对华政策打了B+，并解释，奥巴马对于中美关系长期发展并无重大贡献。1\n<br>基辛格给奥巴马对华政策打了B+，并解释，奥巴马对于中美关系长期发展并无重大贡献。\n<br>　　基辛格同时表示，中美均是全球最具影响力的国家，假如中美爆发军事冲突，其他国家将会纷纷站边，令世界分裂，未必一定有胜利者诞生。为避免开战，中美必须通过对话，了解对方的需要及动机。中美会谈过往通常能取得成果，双方合作务实处理各种事务，然而现今的中美会谈却效果不彰。\n<br>　　与中国联系密切的基辛格称，据他所了解，中方对于美国大选结果感到震惊。此外，基辛格重申中美关系对全球繁荣稳定重要，若发动贸易战，势必两败俱伤。\n<br>奥巴马与基辛格 资料图<br></p>', 'EI20161130000020', '2016-11-30 11:27:14', '100', '<29423894.1.1479346574249.JavaMail.xiaoyun@Alex-PC>', '2016-11-17 09:35:53', '20', '21277', '0', null, null, null);
