INSERT INTO `oa_newsdraft_h` VALUES ('38934', '38934', null, '2', '0', 'ND20160919000012', '2016-09-19 16:57:57', '20', '100', '习近平谈抗战：勿忘国耻 奋发图强', '14886', '21274', '19238', '0', null, null, '1', '1', '0', '习近平谈抗战：勿忘国耻 奋发图强', '<p>央视网消息:今天是2016年9月18日。9时18分，凄厉的防空警报又一次响起，车辆鸣笛，行人肃立。这警报，震撼着沈阳全城;这警报，向生活在和平年代的人们再次发出了“勿忘国耻，牢记历史”的警示。\n<br><br></p>', '21277', '2016-09-19 16:59:20', '21277', '2016-09-21 10:41:27', 'OA_NewsDraft', '-1', null, '0', '1', '0', null);
INSERT INTO `oa_newsdraft_h` VALUES ('40467', '40467', null, '0', '0', 'ND20160920000001', '2016-09-20 09:31:30', '20', '100', '习近平谈“一带一路”这三年：超出预期', '14886', '21274', '19238', '0', null, null, '1', '1', '0', null, '<p>3年前的2013年9月7日，习近平在哈萨克斯坦纳扎尔巴耶夫大学发表演讲，提出了共同建设“丝绸之路经济带”的畅想。\n<br>同年10月，习近平出访东盟，提出共同建设“21世纪海上丝绸之路”。\n<br>“丝绸之路经济带”和“21世纪海上丝绸之路”共同构成了“一带一路”的倡议。\n<br>习近平极重视“一带一路”，在各种重大场合反复谈及。近日，在G20杭州峰会期间，会见外国元首、发表演讲时，他多次谈“一带一路”。\n<br>8月17日，在推进“一带一路”建设工作座谈会上，习近平指出，“一带一路”建设从无到有、由点及面，进度和成果超出预期。他还专门提出8项要求。\n<br>习近平就推进“一带一路”建设提8项要求\n<br>——推进“一带一路”建设工作座谈会\n<br>一是要切实推进思想统一，\n<br>坚持各国共商、共建、共享，遵循平等、追求互利，牢牢把握重点方向，聚焦重点地区、重点国家、重点项目，抓住发展这个最大公约数，不仅造福中国人民，更造福沿线各国人民。中国欢迎各方搭乘中国发展的快车、便车，欢迎世界各国和国际组织参与到合作中来。\n<br>(注：没错，要聚焦重点地区、重点国家、重点项目)\n<br>二是要切实推进规划落实，\n<br>周密组织，精准发力，进一步研究出台推进“一带一路”建设的具体政策措施，创新运用方式，完善配套服务，重点支持基础设施互联互通、能源资源开发利用、经贸产业合作区建设、产业核心技术研发支撑等战略性优先项目。\n<br>(注：重点支持的战略优先项目，主要为：基础设施互联互通、能源资源开发利用、经贸产业合作区建设、产业核心技术研发支撑等)\n<br>三是要切实推进统筹协调，\n<br>坚持陆海统筹，坚持内外统筹，加强政企统筹，鼓励国内企业到沿线国家投资经营，也欢迎沿线国家企业到我国投资兴业，加强“一带一路”建设同京津冀协同发展、长江经济带发展等国家战略的对接，同西部开发、东北振兴、中部崛起、东部率先发展、沿边开发开放的结合，带动形成全方位开放、东中西部联动发展的局面。\n<br>(注：请留意——加强“一带一路”建设同京津冀协同发展、长江经济带发展等国家战略的对接)\n<br>四是要切实推进关键项目落地，\n<br>以基础设施互联互通、产能合作、经贸产业合作区为抓手，实施好一批示范性项目，多搞一点早期收获，让有关国家不断有实实在在的获得感。\n<br>(注：“一批示范性项目”，“一点早期收获”，很关键)\n<br>五是要切实推进金融创新，\n<br>创新国际化的融资模式，深化金融领域合作，打造多层次金融平台，建立服务“一带一路”建设长期、稳定、可持续、风险可控的金融保障体系。\n<br>(注：金融保障体系要具备4个特点——长期、稳定、可持续、风险可控)\n<br>六是要切实推进民心相通，\n<br>弘扬丝路精神，推进文明交流互鉴，重视人文合作。\n<br>(注：文明交流互鉴很重要)\n<br>七是要切实推进舆论宣传，\n<br>积极宣传“一带一路”建设的实实在在成果，加强“一带一路”建设学术研究、理论支撑、话语体系建设。\n<br>(注：舆论工作很重要)\n<br>八是要切实推进安全保障，\n<br>完善安全风险评估、监测预警、应急处置，建立健全工作机制，细化工作方案，确保有关部署和举措落实到每个部门、每个项目执行单位和企业。<br></p>', '21277', '2016-09-20 09:32:07', '21277', '2016-09-20 09:32:07', 'OA_NewsDraft', '-1', null, '0', null, '0', null);
INSERT INTO `oa_newsdraft_h` VALUES ('42517', '42517', null, '0', '0', 'ND20160920000002', '2016-09-20 12:04:17', '20', '100', '博科ERP介绍视频正式版发布', '14886', '21274', '19237', '0', null, null, '1', '1', '0', null, '<p>面对工业互联网、大数据的冲击，传统商业模式正在发生巨大变化，然而企业打造独特核心能力的诉求始终如一。\n<br>   作为企业管理信息化的核心系统，ERP承载着企业经营实时数据，是进行数据洞察、分析与深度应用的焦点。\n<br>   博科ERP基于Yigo语言无代码开发平台，汲取工业时代最佳行业实践，不断满足互联网时代迭代优化的特定业务需求，创造一种全新的信息系统运作方式，从而帮助企业更好地适应现代商务环境，更具效率地与供应商、合作伙伴、客户进行协同，实现全方位管控和一体化管理。<br></p>', '21277', '2016-09-20 12:04:37', '21277', '2016-09-20 12:04:37', 'OA_NewsDraft', '-1', null, '0', null, '0', null);
INSERT INTO `oa_newsdraft_h` VALUES ('42519', '42519', null, '3', '0', 'ND20160920000003', '2016-09-20 12:17:57', '20', '1200', '上海博科资讯董事长沈国康先生2016新春贺辞', '14886', '21274', '38932', '0', null, null, '1', '1', '0', null, '<p>尊敬的博科伙伴们、朋友们，亲爱的各位同事们：大家新年好！\n<br>    值此2016年新春佳节来临之际，我谨代表上海博科资讯股份有限公司向广大客户、合作伙伴和各界朋友，以及辛勤工作在各个岗位上的全体员工及其家人致以衷心的祝福和最亲切的问候！祝大家新春大吉、万事如意！\n<br>    过去的一年，对于博科来说是极不平凡的一年。2015年，博科成功发布了Yigo2.0新产品，与以往的版本相比，Yigo2.0只需“业务建模”和“验证”两个阶段就可以完成信息系统的设计和开发。它代表着当前业界最先进的自动化软件工程，同时具备大数据时代更好的性能体验，Yigo2.0的成功发布将会带领博科飞速步入新的发展高峰。\n<br>    身处互联网时代，我们已经看到，只要能够抓住中国的应用，就可以建立起世界上最大的互联网企业。同样，我觉得抓住“互联网+”时代“大众创业万众创新”这样的机会，在IT的基础架构上，从芯片到服务器到交换，到操作系统，以及各行各业的应用软件完全也可以从中国走出有世界影响力的IT企业，所以，目前这种时势，对博科而言是一个千载难逢的机会！\n<br>    一直以来，如何实现“人与软件的高效连接”？（也就是说如何高效的生产软件以及各项系统之间如何通讯——系统集成）都是困扰整个IT软件行业的核心难题。当然，并不是说像SAP、ORACLE、用友、金蝶等传统软件厂商扮演不了这个角色，而是由于信息时代的大跨度变革，传统手工编码的软件生产方式注定会被颠覆、被时代所淘汰。当巨大的社会需求与软件生产力之间不匹配的时候，自然就需要能与新时代需求同步匹配的新技术、新产品。而早在十年前，博科就在软件工程科学的基础领域进行了大胆的、前瞻性的探索、创新和突破，最终成功推出Yigo语言，乃至当前最新的Yigo2.0版本，这就意味着：传统软件厂商扮演不了的这个角色，博科可以！\n<br>    博科资讯是Yigo语言的创造者，作为软件技术的创新突破，Yigo实现了软件工程的自动化，用图形描述业务，由图形映射系统的“软件生产软件”新模式，极大地解放了软件的生产力。应用Yigo开发信息系统，99%源码由计算机自动生成，效率高、缺陷少；图形化业务建模，易学易用，人力投入少，技术要求低。博科面向大型企业应用的集成化ERP系统就是最有力的例证！该系统业务架构、软件规模和系统复杂度类似于SAP，仅用了2年时间、共计100人年的投入；如用传统方法实现则需要10年、累计近3万人年的投入，这是一个庞大复杂的工程！\n<br>    在此，我代表博科资讯公司向博科ERP团队致敬！当然，也要尤其感谢Yigo第一代及第二代的创造者们！另外还有博科资讯的HRP、LRP、集团财务、电子商务、电子政务等优秀团队！“机会总是留给有准备的人”，正是这些同事们十年如一日的不懈努力和拼搏，才使得博科在技术储备上能够领先于同行一个身位，才使得博科抓住机遇攀登新高峰成为可能！\n<br>    2016年是新的一年，是公司各条战线验证新成果，追求更高标准的一年，也是博科资讯开启新一轮历史篇章的一年；我们将继续秉承中国管理软件技术领袖的使命，仍然致力于在软件技术上实现创新和突破，持续为客户提供更前瞻的信息化解决方案，为推动互联网的创新应用以及中国传统企业的转型与变革做出应有的贡献。公司相信，在全体员工的努力拼搏下，博科未来将会创造出更突出的骄人成绩！\n<br>    最后，在这辞旧迎新的时刻,我谨代表公司董事会、管理层，再次向广大客户、合作伙伴和各界朋友，以及博科全体员工及其家人致以新春的祝福，祝大家在新的一年里工作顺利、身体健康、阖家欢乐、大吉大利！祝愿2016明天更美好！<br></p>', '21277', '2016-09-20 12:18:20', '21277', '2016-11-03 10:05:48', 'OA_NewsDraft', '-1', '16130', '0', '1', '0', null);
INSERT INTO `oa_newsdraft_h` VALUES ('42520', '42520', null, '0', '0', 'ND20160920000004', '2016-09-20 12:19:41', '20', '100', '博科资讯召开Yigo管理软件CAD V5.0新版产品发布会', '14886', '21274', '38931', '0', null, null, '1', '1', '0', null, '<p>2012年9月11日，博科资讯在上海总部举办了一场内部产品发布会，揭开了Yigo管理软件CAD V5.0版本的神秘面纱。对博科资讯而言，Yigo管理软件CAD V5.0版本的诞生是博科软件发展历程上又一个重要的里程碑；对于业界而言，Yigo管理软件CAD V5.0版本也是能够在业内引起轩然大波的一次重大改变。\n<br>     博科资讯董事长兼总裁沈国康、副总裁孔德培等主要领导均出席了本次发布会，在充分肯定Yigo管理软件CAD V5.0新版产品顺利推出的同时，也表达了各自对Yigo管理软件CAD的建议和期望。\n<br>     博科资讯董事长兼总裁沈国康对Yigo管理软件CAD V5.0充满了信心，沈总在发布会上表示：“Yigo管理软件CAD是完全来自中国的创新奇迹，全球找不到第二家，而它将彻底颠覆传统信息化建设模式。”事实上，目前多数企业在信息化建设中始终处于“头疼医头，脚疼医脚”的被动局面，而要想改变这一点，Yigo管理软件CAD毫无疑问是最具震撼力的工具。\n<br>    负责YIGO产品研发的总工告诉我们，Yigo管理软件CAD V5.0版本在原来的基础上增加了更多成功的应用功能，具体表现可简单归纳为：\n<br>    一、新增纯Web应用版本，与Applet版本高度兼容，可无缝作业，轻松并行处理多个项目，让客户使用游刃有余，高效便利。\n<br>    二、在主机未连接服务器的情况下，主机可单独查看或者处理事务，联网模式下数据同步毫不费力。\n<br>    三、提供二次开发接口，系统完善，逻辑清晰，维护和更新变得更简单，灵活性更高。\n<br>    四、支持各种断点，使技术人员能更迅速精准地找到问题和错误进行调试，大大提高了开发效率。\n<br>    五、团队开发，整体集成，大大提升开发效率和产品的质量。每个专业模块由对应的行业专家主导，产品有针对性有敏捷性，集成毫不费力，内容专业严密，真正的做到量身定制的自主开发。\n<br>    在信息化技术高速发展的今天，立足YIGO架构，博科资讯一直在进行不断的创新和思考：未来软件编程的路在何方？显而易见的是，过去的标准化软件已经越来越掣肘企业未来的发展需要，而Yigo管理软件CAD不仅可以为企业自主开发适合本企业实际情况的管理软件，且其独创的无编码开发技术，完全解决了企业信息化在软件编程方面的瓶颈，使得企业可以根据业务的变更，迅速实现“二次开发”，这样以来，不仅使项目周期大大缩短，更重要的是Yigo管理软件CAD凭借强大的管理解析技术彻底颠覆了原有管理软件开发、应用及扩展模式。\n<br>     此次Yigo管理软件CAD V5.0版本高新产品的成功发布，是博科人专注创新、不断超越自我的一个丰硕成果，也是引领博科资讯进一步走向全球市场的契机和希望！<br></p>', '21277', '2016-09-20 12:20:04', '21277', '2016-09-20 12:20:04', 'OA_NewsDraft', '-1', null, '0', null, '0', null);
INSERT INTO `oa_newsdraft_h` VALUES ('42521', '42521', null, '0', '0', 'ND20160920000005', '2016-09-20 12:21:25', '20', '100', '[凯迪网]:软件开发兴起无代码技术', '14886', '21274', '19238', '0', null, null, '1', '1', '0', null, '<p><br>    什么是无代码开发技术？无代码开发技术当前实现了多大程度上“无需手工编码”？其应用如何？\n<br>    就直观意义而言，无代码开发就是无需通过手工编码的软件开发方式。基于这种思想的厂商实践无独有偶、前赴后继，有媒体报道十年前在经济发达的美国、日本就进行了相关项目的研发，而至今较少有宣传其相关科技成果的转化，国内的快速开发工具则在应用层面响应了这种潮流，如以上所提的软件平台，其实质是辅助软件工程工具，它降低了程序员对重复功能代码编写的任务量。\n<br>    ......\n<br>    因此，Yigo语言是无代码开发技术的创新实践，可以减少管理信息系统的建设95%的代码编写。科技界一针见血的指出Yigo就是“一种用软件生产软件的方法”，也有人更钟爱“平台”的说法，认为“Yigo还是一个拥有独特语言的软件平台”，支持者特别强调较之传统的软件平台，首先，Yigo核心是计算机编程语言，业务人员（而非技术人员）可以轻松掌控软件开发过程，可以摆脱其他高级语言的约束，创造一种新的人机交互方式：这种软件开发方法规避了维护过程中文档与代码的一致性问题，最大限度简化了知识转移和软件工程控制过程，为系统维护提供了巨大的便利，针对需求变更，可直接通过图形化工具修改系统原型；其次，Yigo作为计算机编程语言，其本身并不提供功能实现或者业务解决方案，只帮助生态合作者提供统一的技术架构和极简的开发方法，用户可以在Yigo应用市场根据自己的特点选择合适的系统甚至完全定制一套个性化的系统......\n<br>    文章更详细内容请访问凯迪社区：《科技杂谈：软件无代码开发技术的兴起》<br></p>', '21277', '2016-09-20 12:25:34', '21277', '2016-09-20 12:25:33', 'OA_NewsDraft', '-1', null, '0', null, '0', null);
INSERT INTO `oa_newsdraft_h` VALUES ('42522', '42522', null, '2', '0', 'ND20160920000006', '2016-09-20 12:26:28', '20', '100', '博科资讯与中国国信信息总公司达成战略合作伙伴关系', '14886', '21274', '19237', '0', null, null, '1', '1', '1', '博科资讯与中国国信信息总公司达成战略合作伙伴关系', '<p>近日，上海博科资讯股份有限公司（简称“博科资讯”）与中国国信信息总公司达成战略合作协议。\n<br>   中国国信信息总公司（简称“中国国信”）是为国家信息中心领导下的全民所有制企业。是以IT产业为龙头，技、工、贸一体化的大型综合公司。中国国信以创建自主品牌为公司发展战略，努力打造了“国信咨询”、“国信集成”、“国信软件”、“国信监理”、“国信运维”五大国信服务品牌产品，为我国各级政府部门和企事业单位，提供多层次高质量信息化技术服务，并且取得了多项政府颁发的资质证书。\n<br>   上海博科资讯股份有限公司是全球领先的Yigo无代码开发技术创造者，中国管理软件技术领袖, 拥有大型ERP、物流供应链LRP、集团财务、审计、全面预算、电子政务、资产管理EAM、医疗卫生HRP等多个行业管理软件产品。\n<br>   日前，基于双方间良好的信任、及长远发展战略上的考虑，博科资讯与中国国信决定共同携手，在市场开拓、软件研发、项目建设等方面开展战略合作。双方均以优秀的企业理念与专业性，本着“互惠、互利、稳定、恒久、高效、优质”的合作精神，结成深度的战略合作伙伴关系。<br></p>', '21277', '2016-09-20 12:26:48', '21277', '2016-09-20 12:30:39', 'OA_NewsDraft', '-1', null, '0', '1', '0', null);
INSERT INTO `oa_newsdraft_h` VALUES ('42523', '42523', null, '4', '0', 'ND20160920000007', '2016-09-20 12:27:43', '20', '100', '博科应邀参加上海企业家沙龙活动', '14886', '21274', '19237', '0', null, null, '1', '1', '1', '博科应邀参加上海企业家沙龙活动', '<p>5月28日下午，上海市国资委、市发改委、市经济信息化委等相关部门联合举办企业家沙龙活动。活动由市政府副秘书长、市国资委党委书记徐逸波主持，周波副市长出席并讲话。\n<br>    作为企业家沙龙特别邀请的重点企业，博科资讯董事长沈国康、副总裁刘正珩代表上海博科资讯股份有限公司参加了此次活动。同时参加的还有上汽集团、锦江国际、东方国际、百联集团、申能集团、建工集团、华谊集团等市国资委企业及华为、阿里等企业。\n<br>\n<br>    活动以李克强总理在政府工作报告中曾提到过的“互联网+”行动计划为主要议题，重点探讨了新时期的互联网如何与传统行业相结合，如何将互联网的创新成果深度融合于经济社会各领域之中、最终提升实体经济的创新力和生产力等问题。\n<br>    在活动发言中，博科资讯董事长沈国康指出：作为一直活跃在行业最前沿的软件厂商，博科资讯对于互联网技术的创新与应用积累了丰富的经验，也取得了丰硕的成果，其中以Yigo技术最具代表性。沈国康说，不久前，国际最高科技权威杂志《科技纵览》还以《颠覆传统的Yigo语言》为题对Yigo技术进行了全面关注和介绍。\n<br>    Yigo的诞生，让世界上再也没有难做的管理系统。它彻底颠覆了传统的软件生产方式，真正实现了软件开发从工业时代的人工编码到互联网时代“用软件生产软件”的巨大跨越。这种由技术创新带来的时代跨越，使软件生产效率得到了几何倍数的提升和释放，支撑企业迎接互联网经济的挑战，构建随需即变的企业管理信息系统。比如原来我们做一套信息系统可能需要花上几万人年，而现在使用Yigo技术甚至只需要几十人年就可以完成。<br></p>', '21277', '2016-09-20 12:28:14', '21277', '2016-09-23 11:09:33', 'OA_NewsDraft', '-1', null, '0', '1', '0', null);
INSERT INTO `oa_newsdraft_h` VALUES ('42524', '42524', null, '0', '0', 'ND20160920000008', '2016-09-20 12:31:56', '20', '100', '博科资讯在大数据时代企业数字化转型的创新实践分享', '14886', '21274', '19237', '0', null, null, '1', '1', '1', '博科资讯在大数据时代企业数字化转型的创新实践分享', '<p>&nbsp; &nbsp; 6月17日，第二届亚太CIO峰会在上海圆满落幕，以“融合创新——助力CIO开启DT新时代”为主题，携手中外行业顶尖信息化领袖，逐一解读大数据时代“CIO转型与创新”、“企业数字化转型与智能制造”等议题。\n<br>博科资讯在大数据时代企业数字化转型的创新实践分享 boke\n<br>    上海市通信管理局副局长孙万毅作大会致辞、中国工程院院士谭建荣、上海国资委信息处处长李小山分别发表了有关“大型装备数字设计与智能制造”、“国企转型与创新”的主旨演讲，同时博科资讯、埃森哲、世纪互联、神州数码、中科曙光等信息服务厂商应邀出席本次大会，与参会的沪上百强企业CIO进行了企业信息化最新实践的分享。\n<br>博科资讯在大数据时代企业数字化转型的创新实践分享 boke\n<br>    博科资讯ERP事业部总经理蒋正华在题为“工业4.0时代的ERP系统”的主题报告中指出，企业IT能力的建设目标不仅是企业职能部门亲密无间的合作和经营数据毫无阻塞的流动。\n<br>博科资讯在大数据时代企业数字化转型的创新实践分享 boke\n<br>    在移动互联网和大数据的时代，企业组织与业务模式的边界变得更加模糊，传统ERP讲规则、重逻辑、偏刚性，新时代的ERP则需要柔性，具备快速迭代的能力与DNA，往往业务端系统刚刚落实，企业端商业模式又发生变化了。\n<br>    企业信息化在满足行业最佳实践的同时，还需实现信息系统随需而变，每个成功的企业都应该具备一个准IT公司的能力，基于Yigo平台打造的博科ERP已成为打造企业软件平台的重要抓手，面向互联网战略转型，发掘大数据价值，帮助无锡地铁、四达动力、紫江、法尔胜、华锡、力帆时骏等企业在成就独一无二的持续领先优势上获得了成功。<br></p>', '21277', '2016-09-20 12:32:24', '21277', '2016-09-20 12:32:24', 'OA_NewsDraft', '-1', null, '0', null, '0', null);
INSERT INTO `oa_newsdraft_h` VALUES ('42525', '42525', null, '1', '0', 'ND20160920000009', '2016-09-20 12:33:02', '20', '100', '博科资讯举办“信息化管理助力制造业变革”CIO精品沙龙活动', '14886', '21274', '19237', '0', null, null, '1', '1', '1', '博科资讯举办“信息化管理助力制造业变革”CIO精品沙龙活动', '<p>8月24日，上海博科资讯股份有限公司（简称“博科资讯”）在南京顺利举办“信息化管理助力制造业变革”信息化精品沙龙活动。\n<br>   该活动由博科资讯和南京CIO俱乐部主办，江苏省企业信息化协会、江苏CIO联盟、中国联合通信有限公司江苏省分公司和全时云商务服务股份有限公司协办。\n<br>   本次活动邀请了国电南自、南京电信、卫岗乳业、鹏力科技、优倍电气等诸多南京优秀制造企业CIO参加活动。活动围绕CIO共同关心的问题如：云安全技术、智能物流、工业4.0时代ERP实例等主题展开了互动探讨。在活动分享环节，博科资讯还以国家政策《中国制造2025》为切入点，深度分析了工业4.0时代ERP系统在制造业的应用，并结合法尔胜集团的信息化发展经验向大家展示了未来ERP的功能图景。\n<br>   在研讨过程中，大家一致认为，进入工业4.0时代后，传统管理软件将越来越不适应新智能制造时代的发展需要，管理软件领域不可避免地也将迎来新的管理革命，这是一个不可逆转的发展趋势。\n<br>   博科资讯则表示，在工业4.0时代，中国企业的信息化建设模式将完全改变，未来企业将会从全民皆兵的软件产品选型、苦苦等待的产品升级、无休无止的系统维护，转变为企业根据自身业务需求自行配置管理模块和业务流程，并可根据企业和市场的变化随时进行调整，快速智能地满足企业业务拓展、流程变更、功能调整等应用需求。<br></p>', '21277', '2016-09-20 12:33:28', '21277', '2016-09-20 12:33:47', 'OA_NewsDraft', '-1', null, '0', '1', '0', null);
INSERT INTO `oa_newsdraft_h` VALUES ('42526', '42526', null, '2', '0', 'ND20160920000010', '2016-09-20 12:37:16', '20', '100', '周波副市长赴博科资讯调研', '14886', '21274', '19238', '0', null, null, '1', '1', '1', '周波副市长日前赴博科资讯公司调研本市互联网产业发展情况', '<p>&nbsp; &nbsp; 4月30日下午，周波副市长赴博科资讯公司调研本市互联网产业发展情况。市经济和信息化委副主任刘健以及市发改委、市科委和张江管委会相关领导一行到博科资讯陪同调研。公司董事长沈国康携Yigo平台开发团队向访者做了详细介绍。\n<br>　　周波副市长对博科公司的创业者16年来的执着与坚韧表示敬佩，并要求市经信委、发改委、科委和张江管委会要形成合力，要务实地从各自职能出发，做好服务企业，提出了本市国资系统也要主动对接。\n<br>　　Yigo就是一个翻译系统，把自然语言翻译成机器语言，与程序员的作用一样。“蓝模文件”用一张A4纸就能展示，修改十分快捷。传统的管理软件开发先是咨询人员入驻企业，经过数月、一年、甚至更长时间的调研之后，写分析调研报告，一般厚达数百、数千页，甚至更长，一般企业很难完全消化。然后是软件部署、开发、测试、上线、实施。短则数月，长则数年。\n<br>　　企业咨询、实施是一个以分钟为时间单位，价格高得出奇的服务。我们知道咨询师入驻企业一年，软件还没有立项开发，就已经耗去了100万元。\n<br>　　“无代码”3D打印软件不仅彻底改变了由成百上千程序员写代码的“软件工厂”模式，而且可以快速重构。当公司业务升级、管理变革之际，企业IT系统随之需要升级，过去的做法是咨询团队入驻、设研分析、业务部署、软件开发、测试、实施、上线，中间部分环节尚需要多次反复。而Yigo平台生成一套软件的时间只需几秒钟，且高度灵活。因为随时可以推倒重来，快速重构，成本不及原来的十分之一，因为压缩了企业咨询、调研分析、软件开发、测试、实施等环节。不管公司业务如何变化，系统都能随需应变。以yigo为代表的“软软件”，可以随时变化，而原来的软件是硬软件，变化成本很高。\n<br>　　倪光南认为，Yigo平台适合“成长快、变化多、模式创新频繁”本土中国企业，解决了传统管理软件水土不服的问题。\n<br>　　SAP、IBM等公司最早进入中国时，是将“西方企业的最佳实践”在中国的企业身上复制，结果经常产生“水土不服”的服务。业界曾经有句话很流行：上ERP找死，不上ERP等死，就是“西方企业的最佳实践”向中国本土企业移植过程中产生的尴尬。\n<br>　　Yigo最大差别是“我的软件我做主”。企业管理人员、业务人员自己描述公司的管理需求、管理逻辑，商业智慧来自企业本身，然后通过3D打印生成软件系统，而非生搬硬套其他公司的管理经验。\n<br>　　软件开发是一个技术活，管理、业务人员参与程度不深，更谈不上定义“管理需求、管理逻辑”；而Yigo则将软件生产机械化，将软件定义的权利交给用户，企业可以从管理、业务、生态链合作伙伴角度考虑其IT系统。\n<br>　　沈国康1992年创业成立博科。在1998年以前，博科与用友、金碟一样，做的产品财务软件。1998年后，企业信息由财务信息向管理信息化升级，中国管理软件企业面临国外软件企业，比如SAP的竞争，用友、金蝶选择了走SAP的道路。\n<br>　　博科则走了另外一条道路，因为他认识到“硬软件”模式无法适应企业快速变革，必须提供“可生长软件”在中国市场才有前途。所谓可生长，即软件能够跟上企业变化的步伐，低成本甚至零成本重构。\n<br>　　可生长软件是Yigo平台的前身。1998年至2002年，沈国康走了一些弯路，花了不少钱，但产品没有落地；直到2002年，沈国康将团队方向瞄准“无代码开发”，2006年发布第一版，2012年发布了七个版本，最初用于物流行业，现在则用于整个企业管理。迄今为止，Yigo平台的研发费用总计达3亿元。\n<br>　　1998年的沈国康没有看到今天技术环境的变化，但“快速、柔性、灵活”的管理软件无疑符合今天的技术环境，这对博科是意外收获。\n<br>　　很多机构都在“零代码”编程方面进行过尝试。1982年，日本通产省计划10年内投资8亿美元，并联合富士通、NEC、东芝、松下、夏普等八家巨头共同参与，希望完成“人类无需为其编程，只需要口述命令，由计算机自动推理完成任务”的系统。10年后，这一计划破产。\n<br>　　2004年，比尔•盖茨表示，将投资68亿美元研发“图示化”编程工具，实现软件开发的无代码时代，微软至今未提出无代码开发的技术框架及标准。\n<br>　　谷歌则于2009年发布开源编程语言Go语言，目的是在不损失应用程序性能的情况下降低代码的复杂性。谷歌首席软件工程师罗布派克说：“我们之所以开发Go，是因为过去10多年间软件开发的难度令人沮丧。”Yigo平台“将零代码编程的梦想变成了现实，让中国软件业首次走到了西方巨头前面，将引起软件行业的革命”。<br></p>', '21277', '2016-09-20 12:37:59', '21277', '2016-10-10 09:30:58', 'OA_NewsDraft', '-1', null, '0', '1', '0', null);
INSERT INTO `oa_newsdraft_h` VALUES ('42527', '42527', null, '1', '0', 'ND20160920000011', '2016-09-20 12:39:03', '20', '100', '《国家信息化发展战略纲要》解读：信息化驱动工业化的新机遇', '14886', '21274', '38930', '0', null, null, '1', '1', '0', '《国家信息化发展战略纲要》解读：信息化驱动工业化的新机遇', '<p>&nbsp; &nbsp;日前，《国家信息化发展战略纲要》正式颁布，作为对《2006—2020年国家信息化发展战略》的调整与升级，《纲要》描绘了我国在工业化尚未完成的前提下全面推进信息化的路线图，将为未来10年国家信息化发展提供规范和指导。\n<br>   近期，多位领导专家围绕纲要进行了深入解读。概而言之，蓬勃发展的新一代信息技术将成为驱动我国创新发展的新引擎，为我国重构国际竞争新优势提供历史机遇。信息技术加速与各领域技术深度融合，引发了经济社会发展的深刻变革，大力推进信息化与工业化深度融合，推进工业转型升级，已是势在必行。\n<br>   以信息化驱动现代化为主线\n<br>   着力提升信息化应用水平\n<br>   中央网络安全和信息化领导小组办公室副主任庄荣文：习近平总书记指出，“没有信息化就没有现代化”。《战略纲要》按照“五位一体”总体布局，明确了经济、政治、文化、社会、生态文明建设领域的信息化发展任务。经济领域，重点是培育信息经济，推进互联网与一、二、三产业融合创新，促进区域协调发展，强调了要构建新型商业基础设施、优化政策环境，目的是挖掘增长动力，促进转型发展。政治领域，重点是落实全面深化改革的部署，深化电子政务应用，解决信息碎片化、应用条块化、服务割裂化等问题，以信息化促进国家治理体系和治理能力现代化。\n<br>   以信息化驱动产业转型升级\n<br>   国务院发展研究中心信息中心研究员李广乾：《战略纲要》与《战略》之间是一种相互衔接的关系，与10年前相比，物联网、云计算、大数据、移动互联网等新一代信息技术极大地改变了信息化的大环境。我国已经是世界电子商务规模最大、种类最多的国家。此外，微信、微博等社交平台发展的广度和深度都是10年前所难以预料的。以电子支付、快递、BAT为代表的新业态成为了产业转型升级的新平台，加上网络安全、国际环境等都发生了显著变化。《战略纲要》整合了近年来的诸多重大战略，并将这些战略融合到整个信息化建设当中，做到相互促进、相辅相成。对贯彻落实当前有关国家治理体系和治理能力现代化、“一带一路”、“中国制造2025”等重大国家战略进行了具体部署，为服务和促进这些战略提供了技术、产业和基础保障。\n<br>   李广乾认为，信息化促进经济转型升级在以下三个方面可以大有作为。\n<br>   一是新一代信息技术移动互联、物联网、云计算、大数据等本身都是一个个的大产业，同时，它们的迅速发展使得其应用范围的广度和深度进一步加快。二是信息化使得传统产业提质增效，涉及农业、制造业、服务业。在“互联网＋”的大背景下，大多数产业面貌得到了极大的改观。三是互联网经济与传统产业深度融合。以BAT为代表的企业长期以来在泛娱乐化方面发展极为迅速，但是近几年来明显遇到了“瓶颈”，下一步如何与制造业融合则是泛娱乐化的重点，也是以BAT为代表的企业发展的出路所在。\n<br>   智能制造生态系统是信息化新阶段主攻方向\n<br>   工业和信息化部电子科学技术情报研究所周剑：我们既要推进工业化，又要推进信息化，需要兼顾工业化和信息化各自不同的发展规律。在两化融合初期，新型工业化是我们的主要任务，工业化发展规律为主、信息化发展规律为辅；在两化融合中期，二者势均力敌；在两化融合后期，信息化发展规律将占主导地位。当完全进入信息社会，工业经济被信息经济所取代之后，我们就真正进入了信息化发展的新阶段，两化融合的历史使命也才会终结。\n<br>   我国工业化没有完成，平均自动化水平偏低，导致全面推进制造业数字化的基础和能力不足，制造业网络化也因此仅在靠近消费端的领域得到了规模化探索和推进。只有当人、设备设施、制造活动等的数字化达到一定程度，基于数据（信息、知识）大范围、大规模协同应用的制造业网络化才能够取得实质进展；只有当连接到网络中的制造业参与主体、资源、活动等达到一定程度和复杂度，智能处理、自组织、自决策才会凸显其价值且成为发展的必然要求，智能制造生态系统才会日益成熟并成为产业界的普遍选择。因此从工业化、信息化发展的阶段性来看，智能制造生态系统理所应当是两化深度融合的主攻方向，但我国要构筑智能制造生态系统，需加快制造业数字化、网络化和智能化螺旋式发展，任重而道远，亟须因势而动、顺势而为、趁势而上。\n<br>   驱动工业化向智能化演变\n<br>   工信部国际经济技术合作中心中国智造与工业4.0研究所所长王喜文：传统工业化的技术特征是利用机械化、电气化和自动化，实现大规模生产和批量销售。在当前复杂的国际竞争和国内环境下，要提升我国制造业在全球产业价值链中的地位，解决制造业大而不强的问题，就必须从传统生产方式向智能化生产方式转变。\n<br>   现代工业化的技术特征，除了物理系统（机械化、电气化、自动化）之外，还要通过融合信息系统（计算机化、信息化、网络化），最终实现信息物理系统（智能化）。“工业4.0”时代，中国制造业向智能化发展，存在着巨大的空间和潜力。目前，我国正处在工业化的发展进程之中，经济的崛起必定首先依托制造业。新一轮工业革命在带来诸多挑战的同时，也将为我国新一轮制造业发展提供许多难得“契机”。历史经验表明，每一次工业革命都为后发国家成功实现赶超提供“契机”，英、德、美、日等都是通过把握工业革命的机遇而成功的。就我国制造业转型升级而言，新一轮工业革命将会同样带来赶超发展的“契机”。\n<br>   以前，我国制造业技术含量不高，一直处于国际产业价值链的低端环节。工业化和信息化深度融合有效地为制造业的网络化、智能化发展奠定了殷实的基础。毫无疑问，“工业4.0”时代，新一轮工业革命将更快速地带动两化深度融合。信息技术向制造业全面嵌入，将打破传统的生产流程、生产模式和管理方式，生产制造过程与业务管理系统的深度集成，将实现对生产要素的高度灵活配置，实现大规模定制生产，从而有力推动传统制造业加快转型升级的步伐。\n<br>   以博科资讯为代表的国产软件\n<br>   是工业4.0时代中企业变革转型的必然选择\n<br>   对于以上解读，被中国科学院予以了高度评价的创新软件厂商博科资讯认为，无论是信息化推动产业转型升级，还是工业化向智能化的转变，国产化软件的参与和融入对于《战略纲要》的执行和落地都有着非常重要的意义。\n<br>   习近平总书记曾经在论述科技创新问题时指出：真正的核心技术，花钱是买不来的，合作是靠不住的，引进也是走不远的，必须靠自主创新。我们要树立这样的自信，保持这样的定力，不能总是指望依赖他人的科技成果来提高自己的科技水平，更不能成为其他国家的技术附庸。\n<br>   对此，作为国产ERP领域黑马的博科资讯深有感触，近年来，博科ERP业务在广泛的行业大型项目应用及业务深度覆盖领域表现出强劲的市场竞争力，而博科资讯之所以能在竞争中作为国产软件的代表与SAP、Oracle等国际巨头相抗衡，自主知识产权的技术开发和创新驱动是至关重要的原因。\n<br>   简单而言，基于工业4.0大时代的发展趋势和企业自主可控、全流程管理的核心诉求，博科以其Yigo语言核心技术，为企业系统化管理提供了更具创新性和更加人性化的ERP管理软件。据了解，博科资讯自主创新研发的Yigo以其高质量算法、语句结构和容错能力设计不仅规避了人工编码带来的需求分析错误、设计错误、编码错误以及软件缺陷与差错，同时其“蓝图+原型”工作模式在效率层面使小型系统开发提升5-10倍，大型系统提升100倍以上，加之其易学、易替代、环境自适应的属性，这种企业自主信息化的技术已成为工业4.0时代中企业变革转型的必然选择。<br></p>', '21277', '2016-09-20 12:40:29', '21277', '2016-09-20 12:41:12', 'OA_NewsDraft', '-1', null, '0', '1', '0', null);
INSERT INTO `oa_newsdraft_h` VALUES ('42528', '42528', null, '3', '0', 'ND20160920000012', '2016-09-20 12:41:52', '20', '1200', '企业集团财务管控体系的现状分析与建设思路', '14886', '21274', '38930', '0', null, null, '1', '1', '0', '企业集团财务管控体系的现状分析与建设思路', '<p>集团管控的概念\n<br>　 集团管控的指的是公司总部或者高层采用管理控制的方式对下属企业或部门进行管理，以此实现企业朝着集团化、多元化的方向发展。企业集团管控的管理手段有许多种，其本质也并非管与控，而是为了最大限度的发挥管理控制的价值，其理论核心就是为了转变企业管理模式，从外延式扩张转变为内涵式增长。\n<br>　 集团财务管控现状分析\n<br>　 1、下属公司财务管理的一体化缺失\n<br>　 目前，许多集团企业的财务管控模式采用的是下属分、子公司模式，这就使得自主性过强，权力下放而导致集团总部难以对下属公司实施有效的管控，进而加大了集团企业站在整体发展的高度进行财务战略的制定以及相关活动的开展的难度，最终直接导致集团整体经营活动过于分散，下属分、子公司各自为政，为了追求局部利益而对整体利用视而不见，对集团的整体经营效率造成严重的影响。一方面，在融资与投资中，集团的整体资本结构有待完善，在整个集团内部资金链中，难以实现投资与融资规模比例的平衡，对资金的内部融通造成影响，使得外部投资的风险加大；另一方面，下属分、子公司的经营模式导致集团难以实现有效的成本控制，成本的控制力度被削弱，对内部财务核算结果造成影响，造成成本核算信息失真，财务控制处理系统的作用与效果无法得到发挥，进而使得集团财务与税务风险增加。总而言之，目前集团企业实行的这种财务管控模式的整体观念有待提高，过于分散的权力导致集团难以实现对整体财务状况的有效管理与控制，严重阻碍了企业内部各项资源的优化配置，集团内部凝聚力也无法得到保障，最终导致企业的整体实力受损。\n<br>　 2、财务管控观念缺乏科学性\n<br>　 目前，许多集团企业的缺乏先进的财务管控理念，难以提高财务管控的成效。这一问题具体表现在两个方面。一方面，集团企业财务人员的集团财务管控经验不足，难以站在集团总部的整体高度去实施企业发展战略，财务管理工作的开展无法保证集团企业的整体发展，只能够做好总部自身的财务管理工作。在集团内部财务管理与控制制度体系方面缺乏系统性与规范性，因此集团企业分、子公司的财务状况难以得到及时的了解与掌握，因此对其的财务引导与监管就无法充分发挥其应有的作用。另一方面，随着现代企业的不断发展，企业制度也得到了一定的完善，同时《企业财务通则》在企业中也得到了广泛的实施，这就增强了集团企业财务管理环境的灵活性，在发展过程中机遇与挑战共存。然而受限于集团企业财务管理人员队伍建设不到位的问题，许多集团企业的管理人员与财务人员受到传统财务管控模式的影响，对于这一全新的财务管理环境并没有完全适应，企业财务管控理念还没有及时转变，因此在实际财务管控工作中，仍然存在诸多不合理的地方，进而导致集团企业的财务管控效率与发展进程受到阻碍。\n<br>　 3、财务管控人员缺乏配合\n<br>　 传统的财务制度下，集团财务管控人员各自为政，缺乏有效的配合，难以实行有效的管控机制，其整体观念并不强。同时，除了财务管控部门人员之外的其他职能部门的工作人员在集团财务工作中的参与度不高，因此并不了解财务管理的相关内容，因此就谈不上与财务人员的配合。这样的管控模式必然导致财务管理的改革受到限制，加大了集团总部对下属分、子公司的财务管控的难度。\n<br>　 4、财务管控动态性缺失\n<br>　 现阶段，一些集团企业的财务管控体系存在动态性缺失的问题，其建设与监管缺乏全面性，进而增加了财务管控难度，难以实现有效的财务管控。集团企业的事前财务预算分析不到位，事中财务、会计信息失控的情况时有发生，而事后也无法结合预算规划进行年度投资与融资收益结果的考核。缺乏实质的管控内容必然导致事前预算、事中控制以及事后审核等各个环节能以起到足够的效果，因此集团下属分、子公司在执行、选择以及执行财务决策时就无法控制在集团总部财务管理与控制的范围之内，对于集团财务的有效控制是难以接受的。\n<br>　 5、缺乏有力的财务管控\n<br>　 尽管新的财务制度的实施有着显著的效果，然而集团企业缺乏有力的财务管控，导致会计核算出现偏差、财务管理系统混乱、财务管控的作用难以发挥、集团资金流失，进而使得集团企业财务风险抵御能力被削弱，严重影响到集团企业经营活动的正常开展。\n<br>　 集团财务管控体系建设思路\n<br>　 1、坚持集团企业财务管控体系原则\n<br>　 集团企业的资本运营特点在于范围广、跨度大，这就要求集团企业的财务管控应站在集团整体的高度，切实提高集团企业的经营效益。为了实现这一目标，应将集权与分权相统一，采取科学合理的方法，将集团的集中优势充分发挥出来，同时发挥下属公司经营的独立性与自主性，积极进行创新性尝试，为企业带来更大的效益。\n<br>　 2、完善集团企业财务集中管控体制\n<br>　 集团内部必须加强财务管控体制建设，确保其具有规范性与统一性。在设置集团机构方面，应基于财会核算与管理的三大职能实现财务部的设立，并以此进行其他工作小组的设立以实现财务管控的相互协调配合，使各个部门共同完成财务管控工作，提高财务管控效率与效果。在统一财务管控机构后，还应整合集团企业所有财会人员，实行统一管理，对财务人员的行为加以规范，避免不良行为的出现。此外，集团企业还应以国家相关政策与法律法规为指导，加强各项财务管理制度与业务规范的建设，使下属公司的职能与作用得到充分的发挥。最后，还要对企业外部筹资与投资活动进行统一，优化集团企业资源配置，使集团内部资金运行得到协调，提高资源利用率，为企业带来更大的经营效益。\n<br>　 3、加快集团财务信息化建设\n<br>　 集团企业应选择专业的财务管理信息系统，加强信息平台建设，为集团的财务核算、资金管理以及预算控制提供强有力的支持，以此实现财务与业务的集成化，促进集团财务管理的集中化发展。同时，集团还应以多行业背景为基础，加强数据管理体系建设，实现数据的集中化管理。此外，还要加强网络信息建设，集团还应实施对财务核算的网络监控，实现财务信息的实时共享，为财务信息的真实性与完整性提供强有力的保护，为集团总部对下属企业财务经营状况的及时了解与掌控提供有利的支持。最后，还应加强财会业务与管理信息系统建设，使集团资金运作效率得以有效提高。如此才能够使企业财务信息化建设得以实现。\n<br>　 综上，为了促进集团企业的管理与发展，就必须加强集团财务管控体系建设，确保其具有科学性与适用性。为此，集团管理人员应针对财务管控中存在的问题进行细致的分析，并提出相应的改进措施，确保集团财务管控的作用得以充分发挥。<br></p>', '21277', '2016-09-20 12:42:16', '21277', '2016-10-26 18:15:17', 'OA_NewsDraft', '-1', '12289', '0', '1', '0', null);
INSERT INTO `oa_newsdraft_h` VALUES ('42529', '42529', null, '1', '0', 'ND20160920000013', '2016-09-20 12:43:13', '20', '100', '博科资讯：法尔胜泓昇集团ERP项目（一期）成功验收', '14886', '21274', '19237', '0', null, null, '1', '1', '1', '博科资讯：法尔胜泓昇集团ERP项目（一期）成功验收', '<p>&nbsp; &nbsp;日前，由上海博科资讯股份有限公司实施服务的法尔胜金属制品ERP项目（一期），经过半年时间上线试运行后成功验收。法尔胜是我国民营500强企中的典型企业，该项目的成功验收，充分体现了博科ERP产品近年来在行业大型项目应用中表现出的强劲竞争力。\n<br>   江苏法尔胜泓昇集团有限公司(简称法尔胜泓昇集团)是一家从事以金属制品为主，产业涉及光通信、新材料、现代服务业的多元化生产经营企业集团，公司自1990年以来，综合实力一直位居全国金属制品行业第一，是苏南地区首批首家国家级创新型企业。\n<br>   随着企业的扩张，法尔胜泓昇集团希望建立集团信息管控平台，实现集团内部信息流、资金流、物流三流合一，以消除集团内部信息无法共享，数据延迟延后，人力、物力成本高昂等制约企业发展的不利因素。\n<br>   针对法尔胜泓昇集团的信息化需求，结合博科ERP更互联网化、轻量化、无代码化和自动化的突出特点，博科资讯经过严谨细致的调研分析给出了针对性解决方案，其中包括：帮助法尔胜泓昇集团实现原材料、半成品、产成品及物资的库存管理，实时记录库存变动数据，跟踪库存状态，制定产品BOM、工艺等基础数据；实现生产计划的创建、下达、执行和成本归结的全过程管理，由于采购、销售业务在事业部层执行，商品丝基地和钢丝绳基地只是作为生产执行工厂，等等。\n<br>   在项目实施过程中，博科资讯克服了项目内部关联交易多、销售计划生产波动性大等诸多实施难点，与普通IT服务商相比节约了30%的实施时间，保质按时上线。上线后试运行系统完全满足客户初始需求及企业日常业务要求，各部门数据传输便捷，业务流程管理规范，帮助客户提升效率20-30%，费用节省50%。<br></p>', '21277', '2016-09-20 12:43:33', '21277', '2016-09-20 12:43:43', 'OA_NewsDraft', '-1', null, '0', '1', '0', null);
INSERT INTO `oa_newsdraft_h` VALUES ('42530', '42530', null, '0', '0', 'ND20160920000014', '2016-09-20 12:44:41', '20', '100', '博科资讯签约中国移动通信集团湖北有限公司SCM供应链系统项目', '14886', '21274', '19237', '0', null, null, '1', '1', '1', '博科资讯签约中国移动通信集团湖北有限公司SCM供应链系统项目', '<p>&nbsp; &nbsp;2016年9月，上海博科资讯股份有限公司与中国移动通信集团再度携手，签约中国移动通信集团湖北有限公司SCM供应链系统项目。\n<br>   中国移动通信集团公司（简称“中国移动”）是全球网络规模、客户规模最大的移动通信运营商。基站总数超过220万个，客户总数超过8亿户，资产规模达到万亿人民币。1999年7月，根据国务院关于电信、移动分离的产业决策，中国移动通信集团湖北有限公司（简称“湖北移动”）正式成立并开始独立运营，实行省委、省政府和中国移动通信集团公司双重领导。2002年，公司在美国、香港资本市场上市，成为湖北省内最大的一家外商投资企业。公司在全省设有14个分公司，在各地设有分支机构，负责当地的移动通信运营。\n<br>   目前，湖北移动信息化系统由MIS系统、BOSS系统、OA系统、EPMS系统等核心系统组成，但随着公司业务的发展，湖北移动很多创新型业务需要灵活可配置的系统去快速实现和支撑。此外，湖北移动还希望能让整条供应链实现可视化，并对营业厅末梢的管理实现精细化的管理。\n<br>   基于博科Yigo快速灵活、随需即变的系统实现特点，以及双方在以往合作过程中的良好体验，湖北移动再次定点选择博科资讯作为此次供应链信息化项目的合作伙伴，博科资讯为此也将全面展开对湖北移动供应链全模块的优化改造工作。\n<br>   据了解，除湖北移动供应链系统项目外，博科资讯还陆续承接中移动集团及其旗下中移动大区、湖南移动、江苏移动、广西移动、陕西移动、浙江移动、江西移动、内蒙古移动、重庆移动、宁夏移动等十数个省市的供应链信息化项目，累计项目金额约达5000万元，成功帮助中国移动集团提高了物资管理效率和利用效率，降低了整体物流的系统成本，大大提升了中国移动集团的物流供应链管理的整体水平。<br></p>', '21277', '2016-09-20 12:45:00', '21277', '2016-09-20 12:45:00', 'OA_NewsDraft', '-1', null, '0', null, '0', null);
INSERT INTO `oa_newsdraft_h` VALUES ('44056', '44056', null, '3', '0', 'ND20160920000015', '2016-09-20 14:45:29', '20', '1200', '公安审计信息化系统试点项目成功验收将全面推广应用', '14886', '21274', '19237', '0', null, null, '1', '1', '0', '公安审计信息化系统试点项目成功验收将全面推广应用', '<html dir=\"ltr\"><head></head><body contenteditable=\"true\"><p style=\"margin: 0px 0px 5px; padding: 0px; color: rgb(130, 130, 130); font-size: 14px; line-height: 25px; font-family: 宋体, Arial, Verdana, Geneva, sans-serif; widows: 1; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;日前，<a href=\"http://www.bokesoft.com/\" style=\"color: rgb(0, 136, 204); text-decoration: none;\"><strong>博科资讯</strong></a>公安审计信息化系统重庆市试点项目成功完成验收，接下来系统会进入全面推广应用阶段。<br>&nbsp; &nbsp;2016年07月13日，公安部审计局在重庆市公安局召开公安审计信息化系统重庆试点测试工作总结验收会，会议由重庆市公安局纪委书记蒋宣主持。会上重庆市公安局审计处长袁刚汇报了重庆市公安局对公安审计信息化系统的试点测试情况，公安部审计局郭影局长出席会议并讲话。此次会议的召开，标志着公安审计信息化系统试点测试阶段性工作已经结束，接下来将进入系统的全面推广应用阶段。<br>&nbsp;</p><p style=\"margin: 0px 0px 5px; padding: 0px; color: rgb(130, 130, 130); font-size: 14px; line-height: 25px; font-family: 宋体, Arial, Verdana, Geneva, sans-serif; widows: 1; text-align: center; background-color: rgb(255, 255, 255);\"><img alt=\"博科资讯,BOKE,公安审计信息化系统,博科公安审计信息化项目,上海博科资讯股份有限公司\" src=\"http://www.bokesoft.com/statics/images/20160718-1.jpg\" style=\"max-width: none; vertical-align: middle; border: none; width: 600px; height: 400px; background: transparent;\"><br><span style=\"font-size: 13.008px; line-height: 20.0063px;\">公安部审计局郭影局长</span></p><p style=\"margin: 0px 0px 5px; padding: 0px; color: rgb(130, 130, 130); font-size: 14px; line-height: 25px; font-family: 宋体, Arial, Verdana, Geneva, sans-serif; widows: 1; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;郭影局长在会上强调，加强公安审计信息化建设是认真贯彻落实公安部党委关于大力推进四项建设决策部署的重要举措，要作为当前和今后一个时期工作的重中之重。郭影局长要求各单位接下来要做好系统的全面推广应用的准备工作，进一步增强做好信息化建设工作的决心和信心，认真结合公安审计工作实际，要边建边用，以用促建，充分发挥信息化手段的技术优势，切实提高审计工作的实战能力和专业水平。<br>&nbsp;</p><p style=\"margin: 0px 0px 5px; padding: 0px; color: rgb(130, 130, 130); font-size: 14px; line-height: 25px; font-family: 宋体, Arial, Verdana, Geneva, sans-serif; widows: 1; text-align: center; background-color: rgb(255, 255, 255);\"><img alt=\"博科资讯,BOKE,公安审计信息化系统,博科公安审计信息化项目,上海博科资讯股份有限公司\" src=\"http://www.bokesoft.com/statics/images/20160718-2.jpg\" style=\"max-width: none; vertical-align: middle; border: none; width: 600px; height: 400px; background: transparent;\"><br><span style=\"font-size: 13.008px; line-height: 20.0063px;\">公安审计信息化系统重庆试点测试工作总结验收会现场</span></p><p style=\"margin: 0px 0px 5px; padding: 0px; color: rgb(130, 130, 130); font-size: 14px; line-height: 25px; font-family: 宋体, Arial, Verdana, Geneva, sans-serif; widows: 1; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;公安审计信息化系统是2015年10月经政府采购程序，由上海博科资讯股份有限公司中标并承建，经过二个月的项目建设，完成上线部署工作。公安部审计局经评估决定由江西省公安厅和重庆市公安局进行试点测试工作，在江西省公安厅和重庆市公安局配合下，经过半年的运行测试，项目组对系统进行了进一步优化和完善。此次会议的成功召开，表明公安审计信息化系统已经通过了公安部审计局的测试验收，系统试点测试阶段性工作也已圆满完成，接下来将进入系统全面推广应用阶段。</p></body></html>', '21277', '2016-09-20 14:48:41', '21277', '2016-10-26 18:15:33', 'OA_NewsDraft', '-1', '8961', '0', '1', '23837', null);
INSERT INTO `oa_newsdraft_h` VALUES ('56338', '56338', null, '1', '0', 'ND20160922000001', '2016-09-22 12:50:37', '20', '100', '博科资讯举办“信息化管理助力制造业变革”CIO精品沙龙活动', '14886', '21274', '19237', '0', null, null, '1', '1', '0', '博科资讯举办“信息化管理助力制造业变革”CIO精品沙龙活动', '<html dir=\"ltr\"><head></head><body contenteditable=\"true\"><p><span style=\"color: rgb(130, 130, 130); font-family: 宋体, Arial, Verdana, Geneva, sans-serif; font-size: 14px; line-height: 25px; widows: 1; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;8月24日，上海博科资讯股份有限公司（简称“博科资讯”）在南京顺利举办“信息化管理助力制造业变革”信息化精品沙龙活动。</span><br style=\"color: rgb(130, 130, 130); font-family: 宋体, Arial, Verdana, Geneva, sans-serif; font-size: 14px; line-height: 25px; widows: 1; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(130, 130, 130); font-family: 宋体, Arial, Verdana, Geneva, sans-serif; font-size: 14px; line-height: 25px; widows: 1; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;该活动由</span><a href=\"http://www.bokesoft.com/\" style=\"color: rgb(0, 136, 204); text-decoration: none; font-family: 宋体, Arial, Verdana, Geneva, sans-serif; font-size: 14px; line-height: 25px; widows: 1; background-color: rgb(255, 255, 255);\"><strong>博科资讯</strong></a><span style=\"color: rgb(130, 130, 130); font-family: 宋体, Arial, Verdana, Geneva, sans-serif; font-size: 14px; line-height: 25px; widows: 1; background-color: rgb(255, 255, 255);\">和南京CIO俱乐部主办，江苏省企业信息化协会、江苏CIO联盟、中国联合通信有限公司江苏省分公司和全时云商务服务股份有限公司协办。</span><br style=\"color: rgb(130, 130, 130); font-family: 宋体, Arial, Verdana, Geneva, sans-serif; font-size: 14px; line-height: 25px; widows: 1; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(130, 130, 130); font-family: 宋体, Arial, Verdana, Geneva, sans-serif; font-size: 14px; line-height: 25px; widows: 1; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;本次活动邀请了国电南自、南京电信、卫岗乳业、鹏力科技、优倍电气等诸多南京优秀制造企业CIO参加活动。活动围绕CIO共同关心的问题如：云安全技术、智能物流、工业4.0时代ERP实例等主题展开了互动探讨。在活动分享环节，博科资讯还以国家政策《中国制造2025》为切入点，深度分析了工业4.0时代ERP系统在制造业的应用，并结合法尔胜集团的信息化发展经验向大家展示了未来ERP的功能图景。</span><br style=\"color: rgb(130, 130, 130); font-family: 宋体, Arial, Verdana, Geneva, sans-serif; font-size: 14px; line-height: 25px; widows: 1; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(130, 130, 130); font-family: 宋体, Arial, Verdana, Geneva, sans-serif; font-size: 14px; line-height: 25px; widows: 1; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;在研讨过程中，大家一致认为，进入工业4.0时代后，传统管理软件将越来越不适应新智能制造时代的发展需要，管理软件领域不可避免地也将迎来新的管理革命，这是一个不可逆转的发展趋势。</span><br style=\"color: rgb(130, 130, 130); font-family: 宋体, Arial, Verdana, Geneva, sans-serif; font-size: 14px; line-height: 25px; widows: 1; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(130, 130, 130); font-family: 宋体, Arial, Verdana, Geneva, sans-serif; font-size: 14px; line-height: 25px; widows: 1; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;博科资讯则表示，在工业4.0时代，中国企业的信息化建设模式将完全改变，未来企业将会从全民皆兵的软件产品选型、苦苦等待的产品升级、无休无止的系统维护，转变为企业根据自身业务需求自行配置管理模块和业务流程，并可根据企业和市场的变化随时进行调整，快速智能地满足企业业务拓展、流程变更、功能调整等应用需求。</span></p></body></html>', '21277', '2016-09-22 12:52:32', '21277', '2016-09-22 12:54:04', 'OA_NewsDraft', '-1', null, '0', '1', '23837', null);
INSERT INTO `oa_newsdraft_h` VALUES ('58642', '58642', null, '3', '0', 'ND20160922000004', '2016-09-22 16:54:59', '20', '1200', '博科资讯签约杭州诺辉健康科技有限公司物流信息系统项目', '14886', '21274', '19237', '0', null, null, '1', '1', '0', '博科资讯签约杭州诺辉健康科技有限公司物流信息系统项目', '<html dir=\"ltr\"><head></head><body contenteditable=\"true\"><p><span style=\"color: rgb(130, 130, 130); font-family: 宋体, Arial, Verdana, Geneva, sans-serif; font-size: 14px; line-height: 25px; widows: 1; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;日前，博科资讯成功签约杭州诺辉健康科技有限公司（以下简称：诺辉健康）物流信息系统项目，该项目将会以博科</span><a href=\"http://www.bokesoft.com/product/myscm\" style=\"color: rgb(0, 136, 204); text-decoration: none; font-family: 宋体, Arial, Verdana, Geneva, sans-serif; font-size: 14px; line-height: 25px; widows: 1; background-color: rgb(255, 255, 255);\"><strong>MySCM</strong></a><span style=\"color: rgb(130, 130, 130); font-family: 宋体, Arial, Verdana, Geneva, sans-serif; font-size: 14px; line-height: 25px; widows: 1; background-color: rgb(255, 255, 255);\">系统为基础，并基于MySCM根据诺辉健康信息化管理需要进行相关个性化开发。</span><br style=\"color: rgb(130, 130, 130); font-family: 宋体, Arial, Verdana, Geneva, sans-serif; font-size: 14px; line-height: 25px; widows: 1; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(130, 130, 130); font-family: 宋体, Arial, Verdana, Geneva, sans-serif; font-size: 14px; line-height: 25px; widows: 1; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;据了解，诺辉健康目前已经部署了相关的ERP系统与电子商务门户，为了更好地对公司整体库存可视化、仓储作业、包装耗材及物流运输等环节进行管理和优化，同时解决与公司原有ERP系统、第三方快递公司系统等并行系统的接口问题，诺辉健康最终选择与物流供应链软件市场占有率最高的博科资讯合作，共同建设此次仓储物流信息化项目。据相关人员介绍，博科资讯针对该项目所提供的信息化解决方案涉及订单管理，物料管理，运输管理，报表管理，仓库作业策略管理，仓储管理—RF应用，仓储作业绩效管理，电子签章等功能。</span></p></body></html>', '21277', '2016-09-22 16:55:30', '21277', '2016-10-26 18:15:45', 'OA_NewsDraft', '-1', '10241', '0', '1', '0', null);
INSERT INTO `oa_newsdraft_h` VALUES ('59156', '59156', null, '3', '0', 'ND20160922000005', '2016-09-22 17:27:16', '20', '1200', '中兴通讯与证通股份达成战略合作 发力支付、互联网金融业务', '14886', '21274', '19238', '0', null, null, '1', '1', '0', '中兴通讯与证通股份达成战略合作 发力支付、互联网金融业务', '<p>&nbsp; &nbsp; &nbsp; &nbsp;中兴通讯今日发布公告，中兴通讯、证通股份、中兴通讯全资子公司深圳市中兴软件有限责任公司及证通股份全资子公司上海沃芮欧信息科技有限公司于2016年6月16日签署《战略合作协议》，约定中兴通讯与证通股份在支付业务、互联网金融等领域开展广泛合作，实现优势互补、共赢互惠。中兴通讯与证通股份将利用各自在IT和金融领域的优势，为对方提供业务支持，并共同拓展相关市场。证通股份将支持讯联智付继续为中兴通讯的智慧城市等业务提供支付服务。双方将进一步探讨资本及业务合作的可能性。\n<br>       同时，中兴软件与上海沃芮欧于2016年6月16日签署《关于转让深圳市讯联智付网络有限公司90%股权之股权转让协议》，约定中兴软件以人民币3.825亿元向上海沃芮欧出售中兴软件下属深圳市讯联智付网络有限公司90%股权。本次交易完成后，中兴软件将持有讯联智付10%股权。\n<br>       出售讯联智付控股权可以有效引入外部资源，增强中兴通讯第三方支付的方案提供能力，更好地为M-ICT核心战略提供服务。同时，中兴通讯与证通股份可探讨通过股权方式达成进一步合作，发挥各自优势共同促进业务发展。\n<br>       证通股份具备较强的金融行业背景，本次交易使双方达成股权及业务方面的合作，将对中兴通讯进一步拓展金融领域业务提供支持。\n<br>       本次交易后，中兴通讯还将通过业务合作的方式继续获得讯联智付第三方支付服务的支持，同时，公司通过中兴软件继续持股讯联智付，讯联智付及受让方也承诺以较为优惠的价格为公司相关业务提供服务，本次股权转让不影响公司相关业务整体解决方案的完整性，不会对公司现有业务造成相关影响。\n<br>       本次转让讯联智付90%股权预计将为中兴通讯合并报表增加投资收益约3.0亿元至3.8亿元之间，具体金额以本次股权转让完成后中兴通讯实际经审计报表为准。本次股权交易完成后讯联智付将不再纳入公司财务报表的合并范围。<br></p>', '21277', '2016-09-22 17:30:08', '21277', '2016-10-26 18:16:28', 'OA_NewsDraft', '-1', '10497', '0', '1', '23837', null);
INSERT INTO `oa_newsdraft_h` VALUES ('59158', '59158', null, '3', '0', 'ND20160922000006', '2016-09-22 17:51:00', '20', '1200', '中兴通讯与中国联通签署5G和物联网联合创新战略合作协议', '14886', '21274', '19237', '0', null, null, '1', '1', '1', '中兴通讯与中国联通签署5G和物联网联合创新战略合作协议', '<p>&nbsp; &nbsp; &nbsp; &nbsp;近日，中兴通讯与中国联通举行5G和物联网联合创新战略合作签约仪式，中国联通副总经理邵广禄、中兴通讯CTO徐慧俊出席仪式并签署协议。双方将充分发挥各自优势，匹配国家创新和企业发展战略，在5G和物联网两大创新领域展开深入合作，共同培育良好生态环境，推动产业持续发展。 \n<br>        中兴通讯将与中国联通通过联合创办项目的方式，在5G和物联网的应用场景、产品需求、业务应用、市场发展等相关领域展开研究与合作，形成契合网络发展的演进需求和新业务模式探索等研究成果，为双方长期技术合作奠定坚实基础，实现共赢。\n<br>        在5G领域，双方将重点关注网络架构、移动边缘计算及跨层优化、承载等5G关键技术的研究和投入，共同推进5G发展战略，联合推进5G标准化。\n<br>        在物联网领域，双方进行物联网关键技术的研究和验证，业务解决方案和产品研发，推进技术成熟，促进产业合作。\n<br>       中国联通副总经理邵广禄表示：“中兴通讯作为国际领先的设备厂商与中国联通一直有着长期的合作关系。本次双方在5G和物联网领域的合作，冲破原始的商务和设备合作，上升为前端性的研发和技术合作。下一步中国联通将考虑联合有共同资源禀赋的运营商与中兴通讯共同展开战略合作，推动未来网络发展、技术研究和商业模式。希望双方的合作尽快出成果，同时祝愿中兴通讯在未来取得更大的成功。”\n<br>       中兴通讯CTO徐慧俊表示：“中兴通讯将5G与物联网作为公司核心战略，致力成为全球5G与物联网先锋。中国联通与中兴通讯是长期的战略合作伙伴。中兴通讯很高兴能与中国联通一起，加强5G、物联网及未来新技术的研究，共同推动产业进程、网络发展、技术研究，助力中国联通开启5G与物联网时代。双方将共同携手、不断创新，推动新技术产业的发展。<br></p>', '21277', '2016-09-22 17:51:45', '21277', '2016-10-26 18:15:55', 'OA_NewsDraft', '-1', '10498', '0', '1', '0', null);
INSERT INTO `oa_newsdraft_h` VALUES ('70418', '70418', null, '3', '0', 'ND20160926000001', '2016-09-26 10:19:04', '20', '1200', '新闻发布', '14886', '21274', '38930', '0', null, null, '1', '1', '0', '新闻发布', null, '21277', '2016-09-26 10:19:37', '21277', '2017-01-13 11:16:36', 'OA_NewsDraft', '-1', '12545', '0', '1', '23837', null);
INSERT INTO `oa_newsdraft_h` VALUES ('84755', '84755', null, '2', '0', 'ND20161010000001', '2016-10-10 09:08:52', '10', '1100', '中兴通讯发布M-ICT2.0 界定开拓未来的VOICE五大战略方向 ', '14886', '21274', '19237', '0', '', '中兴通讯发布M-ICT2.0 界定开拓未来的VOICE五大战略方向 ', '1', '1', '1', '中兴通讯发布M-ICT2.0 界定开拓未来的VOICE五大战略方向 ', '<p>今日，中兴通讯正式对外发布M-ICT2.0白皮书，这是公司在M-ICT 1.0版本中确认了M-ICT产业演进大势之后，进一步具体界定了公司面向未来的五大战略方向。\n<br>中兴通讯认为，在M-ICT的大产业趋势下，未来数年，万物互联、泛在智能、虚实结合将无处不在，业务部署普遍云化，开放共享成为潮流。重大变革集中体现在五大方向：虚拟virtuality、开放Openness、智能Intelligence、云化Cloudification和万物互联Internet of Everything，概括为VOICE，它们构成了数字化转型的核心要素，互相协同和激发，将推动形成以需求为中心、以技术为支撑、以商业模式为驱动的三位一体的新商业范式。中兴通讯认为公司必须据此深化M-ICT战略，并将依此逐步勾画出公司的投资、研发、市场重点，形成开拓未来的路线图。\n<br>具体而言，在虚拟方向上，中兴通讯将聚焦在大视频和VR/AR等核心技术和应用，依托公司过去在云管端各环节的深厚积累，从运营商端到端大视频方案、多媒体芯片、云视频会议、VR/AR、新一代智能融合终端、典型行业应用等关键点取得突破。\n<br>在开放方向上，中兴通讯将围绕开源、生态圈、共享经济，开展“三大重构”：研发模式重构、产业链重构、价值网络重构。开源方面，聚焦运营商领域、芯片领域、ICT基础设施领域三大领域的重点开源社区，包括OPNFV、OpenDaylight、Open-O、OSM、OpenStack、Ceph、Linaro等，积极参与贡献；产业链方面，聚焦终端、智慧城市、物联网等三大重点领域，加强生态圈建设；共享经济方面，做好使能者和探索运营，重点拓展共享网络、智慧城市、能源互联网等领域。\n<br>在智能方向上，中兴通讯将从四方面发力：基础智能方面，聚焦智能处理的有关芯片、OS及模块等核心能力，坚定做好“芯”；计算智能方面，围绕着运营商、智慧城市、金融等关键应用场景，加强大数据平台、分布式数据库运用，让大数据活起来；感知智能方面，汇聚运用机器视觉、自然语言处理等感知智能技术，推动智能化综合方案在智能运维、安防、智能客服等领域落地；认知智能方面，加强合作积累认知平台运营能力，为客户创造新的价值。”\n<br>在云化方向上，中兴通讯认为，云计算不仅逐渐颠覆各行业IT技术架构和IT使用模式，也逐步推动电信网络向软件定义、灵活弹性、能力开放的目标架构演进。云化既是挑战，更是机遇。中兴通讯将遵循端管加速、IT升级、平台云化、运营拓展的思路迎接挑战和机遇。终端和管道产品加速升级，推进5G、400G光网络、100GE路由器、10G PON等新技术和产品应用，抓住SDN/NFV机会，推动电信网络向ElasticNet架构演进；聚焦云计算架构的IT基础设施，助力各行业IT应用云化升级；打造PaaS能力和产品，支撑运营商数字化转型，落地智慧城市及重点行业；探索云服务，聚焦智慧城市、金融云、制造云等领域。\n<br>在万物互联方向上，中兴通讯将加强行业协同，打造物联网平台，打通信息孤岛，推动形成产业规模效应。公司将重点打造生态圈平台及资本平台两大支撑平台，在终端、网络、IoE PaaS三大层面布局，聚焦智慧城市、智慧家庭、工业互联网、车联网四大垂直领域，把握物联网发展机遇。\n<br>聚焦和选择VOICE是中兴通讯深化M-ICT战略的关键步骤。面对扑面而来的充满巨大创新与想象空间的新时代，中兴通讯开始了关键的落子布局，智慧联接万物，聆听未来声音（VOICE of Future）。中兴通讯将围绕VOICE延展业务范畴和内涵，形成企业未来的新定位，与全球客户及合作伙伴一起共赢未来。<br></p>', '21277', '2016-10-10 09:09:53', '21277', '2016-10-27 08:55:41', 'OA_NewsDraft', '-1', '14339', '0', '1', '0', null);
INSERT INTO `oa_newsdraft_h` VALUES ('84757', '84757', null, '3', '0', 'ND20161010000002', '2016-10-10 09:15:23', '10', '1200', '中兴通讯加入Avanci专利授权G5联盟 全球物联网将迎加速期', '14886', '21274', '19237', '0', null, null, '1', '1', '1', '中兴通讯加入Avanci专利授权G5联盟 全球物联网将迎加速期', '<p>中国5G试验是全球首个由政府主导和规划的5G试验，由工信部主导、IMT-2020（5G）推进组负责实施。通过5G国家试验，对5G各项关键技术进行充分的研究和论证，对有竞争力的方案进行标准化推动，加快产业化进程，实现2020年商用5G的目标。\n<br>\n<br>作为全球5G先锋，中兴通讯在5G关键技术研究方面全面布局，核心技术重点投入。中兴通讯全力支持国家的5G战略，努力促进5G技术研发与产业发展，致力于成为2020年第一批提供5G商用设备的供应商，为我国2020年启动5G商用奠定良好基础。\n<br>\n<br>5G国家测试正式开启 中兴通讯顺利完成第一阶段关键技术测试。<br></p>', '21277', '2016-10-10 09:20:12', '21277', '2016-10-27 08:54:35', 'OA_NewsDraft', '-1', '14337', '0', '1', '0', null);
INSERT INTO `oa_newsdraft_h` VALUES ('84759', '84759', null, '3', '0', 'ND20161010000003', '2016-10-10 09:22:13', '10', '1200', 'Pre5G目标与核心', '14886', '21274', '19237', '0', null, null, '1', '1', '1', 'Pre5G目标与核心', '<p>Pre5G展示了4G网络演进的前景，填补了在5G商用前近5年的时间空白，构建了4G网络通往5G未来世界的桥梁。\n<br>\n<br>Pre5G内涵：基于4G网络的平滑演进；兼容4G终端；聚焦高话务、高端用户、高速率业务需求，局部部署，网络投资效益最大化。\n<br>\n<br>Pre5G性能指标：超过1G的小区峰值、50M的平均用户速率、100K的小区连接、5倍于4G的频谱效率以及10ms时延。\n<br>\n<br>Pre5G四个核心领域：Giga+ MBB、Superior Experience、Massive IoT、Cloudization。<br></p>', '21277', '2016-10-10 09:23:13', '21277', '2016-10-27 08:55:04', 'OA_NewsDraft', '-1', '14338', '0', '1', '0', null);
INSERT INTO `oa_newsdraft_h` VALUES ('84761', '84761', null, '3', '0', 'ND20161010000004', '2016-10-10 09:36:22', '10', '1200', '2016世界宽带论坛（BBWF）', '14886', '21274', '19237', '0', null, null, '1', '1', '1', '2016世界宽带论坛（BBWF）', '<p>2016世界宽带论坛（BBWF）将于10 月 18 日-10 月 20 日在英国伦敦 ExCeL 会展中心举行。作为全球领先的通信解决方案提供商之一，中兴通讯将通过业务创新、宽带接入、弹性网络、互联网化运营等主题展区展示M-ICT时代下的智慧网络生活。\n<br>\n<br>大会期间，全球领先的专业信息和服务提供商Informa将联合中兴通讯携手产业链合作伙伴，共同举办“2016大视频峰会”。我们将携手全球合作伙伴，展现多彩视频业务，提供极致视频体验，构建精品视频网络，共建共赢视频生态圈。\n<br>\n<br>作为M-ICT时代的使能者，我们期待和您一起在伦敦点亮未来智慧生活！<br></p>', '21277', '2016-10-10 09:37:20', '21277', '2016-10-26 18:14:18', 'OA_NewsDraft', '-1', '13825', '0', '1', '0', null);
