INSERT INTO `oa_newsdraft_h` VALUES ('106003', '106003', null, '5', '0', 'ND20161104000001', '2016-11-04 10:25:41', '10', '1200', '青海省委书记王国生和省委副书记、省长郝鹏率党政代表团来紫金（江宁）考察', '14886', '21274', '19237', '0', null, null, '1', '1', '1', '青海省委书记王国生和省委副书记、省长郝鹏率党政代表团来紫金（江宁）考察', '<p>青海省委书记王国生和省委副书记、省长郝鹏率党政代表团来紫金（江宁）考察<br></p>', '21277', '2016-11-04 10:26:10', '21277', '2016-11-04 10:27:09', 'OA_NewsDraft', '-1', '16385', '0', '1', '0', null);
INSERT INTO `oa_newsdraft_h` VALUES ('106005', '106005', null, '3', '0', 'ND20161104000002', '2016-11-04 10:34:57', '10', '1200', '紫金（江宁）科技创业特别社区', '14886', '21274', '38930', '0', null, null, '1', '1', '1', '紫金（江宁）科技创业特别社区', '<p>&nbsp; &nbsp; &nbsp;紫金（江宁）科技创业特别社区规划总用地面积约4.62平方公里，位于江苏省南京市京沪高铁火车南站至禄口国际机场发展“金轴”与环绕城高速创新经济增长带的交汇点，居于江宁区中心位置，是“上秦淮”规划的核心区域，科教人才、区位交通、生态环境尤为突出。\n<br>\n<br>    紫金（江宁）科创特区与南京唯一国家级海外高层次人才创新创业基地（“千人计划”基地）——江宁开发区融为一体，依托中国（南京）未来网络谷（无线谷）、南京大学江宁科技园，聚焦信息与通信产业（ICT）的技术研发及产业化，特别突出无线通讯、未来网络、增材制造（3D打印）等科技前沿产业，融合科技创新、总部经济、公共服务、金融服务、商务办公、生活居住等功能于一体，建设孵化器、加速器、中试用房等科技创新载体，以及人才公寓、生态湿地公园等，力争建成为全市最优秀的创新创业人才集聚区之一，成为全市20个紫金科创特区中的先行示范区。<br></p>', '21277', '2016-11-04 10:35:57', '21277', '2016-11-04 10:36:10', 'OA_NewsDraft', '-1', '16386', '0', '1', '0', null);
