DROP TABLE IF EXISTS `wf_planitems`;
CREATE TABLE `wf_planitems` (
  `OID` bigint(20) NOT NULL default '0',
  `SOID` bigint(20) default NULL,
  `POID` bigint(20) default NULL,
  `VERID` int(11) default NULL,
  `DVERID` int(11) default NULL,
  `SendUser` bigint(20) default NULL,
  `SendTime` date default NULL,
  `Status` int(11) default NULL,
  `BillKey` varchar(255) default NULL,
  `BillOID` bigint(20) default NULL,
  `WorkPlan` varchar(255) default NULL,
  `ReadUser` varchar(255) default NULL,
  `MapCount` int(11) default NULL,
  `Slock` int(11) default NULL,
  PRIMARY KEY  (`OID`),
  UNIQUE KEY `I_WF_PlanItems_SOID` (`SOID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of wf_planitems
-- ----------------------------

-- ----------------------------
-- Table structure for wf_workitem
-- ----------------------------
DROP TABLE IF EXISTS `wf_workitem`;
CREATE TABLE `wf_workitem` (
  `WorkitemID` bigint(20) NOT NULL default '0',
  `WorkitemName` varchar(255) default NULL,
  `WorkitemState` int(11) default NULL,
  `CreatTime` datetime default NULL,
  `FinishTime` datetime default NULL,
  `OperatorID` bigint(20) default NULL,
  `SrcOperatorID` bigint(20) default NULL,
  `AuditResult` int(11) default NULL,
  `UserInfo` varchar(255) default NULL,
  `ResultInfo` varchar(255) default NULL,
  `InlineNodeID` int(11) default NULL,
  `NodeID` int(11) default NULL,
  `NodeType` int(11) default NULL,
  `LaunchInfo` varchar(255) default NULL,
  `TransactionID` int(11) default NULL,
  `AssistTransactionID` int(11) default NULL,
  `MapCount` int(11) default NULL,
  `Slock` int(11) default NULL,
  `TransitTo` int(11) default NULL,
  `NodeKey` varchar(255) default NULL,
  `TransferType` int(11) default NULL,
  PRIMARY KEY  (`WorkitemID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

